svg.script:
var lMouseDragging = true;
var hideTimeLine = false;
var X1 = 0;
var Y1 = 0;
var X2 = 0;
var Y2 = 0;

var SVGDoc = null;
var SVGRoot = null;
var SVGViewBox = null;

function Init(evt) {
    SVGDoc = evt.target.ownerDocument;
    SVGRoot = SVGDoc.documentElement;

    SVGRoot.addEventListener('click', mouseClicked, false);
    SVGRoot.addEventListener('mousemove', mouseMove, false);
    SVGRoot.addEventListener('keypress', keyPressed, false);
    if(typeof(top) !== "undefined")
        browserFix();
}

function keyPressed(evt) {
    var chCode = evt.charCode? evt.charCode : evt.keyCode;
    if (chCode == 72 || chCode == 104) {
        hideTimeLine = !hideTimeLine;
        hideLine();
    }
}

function mouseClicked(evt) {
    lMouseDragging = !lMouseDragging;
}

function mouseMove(evt) { 
    var p = document.documentElement.createSVGPoint();
    evt = evt || window.event;
    p.x = evt.clientX;
    p.y = evt.clientY;
    try {
        if (evt.pageX || evt.pageY) {
            p.x = evt.pageX;
            p.y = evt.pageY;
        }
        else{
            p.x = evt.clientX + (document.documentElement.scrollLeft + document.body.scrollLeft);
            p.y = e.clientY + (document.documentElement.scrollTop + document.body.scrollTop);
        }
    }
    catch (e){}

    var timeLine = document.getElementById("timeline");
    var timeLineUp = document.getElementById("timeline_up");
    var timeLineDown = document.getElementById("timeline_down");
    var timeLabel = document.getElementById("TimeLineLabel");

    if (timeLine && timeLabel) {
        var m = timeLine.getScreenCTM();
        var scale = parseFloat(timeLine.getAttribute("vertScale"));
        p = p.matrixTransform(m.inverse());
        var indicatorLineWidth = 10;
        if (lMouseDragging){
            if (timeLine){
                var minY = Number(timeLine.getAttribute("minY"));
                var maxY = Number(timeLine.getAttribute("maxY"));
                var myBox = Number(timeLine.getAttribute("isBox"));
                var myX2 = Number(timeLine.getAttribute("x2"));
                var myHeight = Number(timeLine.getAttribute("boxHeight"));

                if (p.y > minY) {
                    minY = p.y;
                }
                if (minY > maxY) {
                    minY = maxY
                }

                timeLine.setAttribute("y1", minY);
                timeLine.setAttribute("y2", minY);

                // This sets the attributes for the indicators for one unit up and down
                // p.x and minY are where the mouse currently is
                // This is when timeline is floating

                if(myBox > 0){
	                timeLineUp.setAttribute("y1", minY - (myHeight/2)*scale);
	                timeLineUp.setAttribute("y2", minY - (myHeight/2)*scale);
	                timeLineDown.setAttribute("y1", minY + (myHeight/2)*scale);
	                timeLineDown.setAttribute("y2", minY + (myHeight/2)*scale);

	                timeLineUp.setAttribute("x1", 0);
                	timeLineUp.setAttribute("x2", myX2);

                	timeLineDown.setAttribute("x1", 0);
                	timeLineDown.setAttribute("x2", myX2);
                }
                else{
                	timeLineUp.setAttribute("y1", minY - scale);
	                timeLineUp.setAttribute("y2", minY - scale);
	                timeLineDown.setAttribute("y1", minY + scale);
	                timeLineDown.setAttribute("y2", minY + scale);

	                timeLineUp.setAttribute("x1", p.x - indicatorLineWidth / 2);
                	timeLineUp.setAttribute("x2", p.x + indicatorLineWidth / 2);

                	timeLineDown.setAttribute("x1", p.x - indicatorLineWidth / 2);
                	timeLineDown.setAttribute("x2", p.x + indicatorLineWidth / 2);
                }
            }
        }
        else {
        	if (timeLine){
            	var minY = Number(timeLine.getAttribute("minY"));
            	var maxY = Number(timeLine.getAttribute("maxY"));
            	var myBox = Number(timeLine.getAttribute("isBox"));
            	var myX2 = Number(timeLine.getAttribute("x2"));

            	if (p.y > minY) {
                	minY = p.y;
            	}
            	if (minY > maxY) {
                	minY = maxY
            	}

                if(myBox > 0){
	                timeLineUp.setAttribute("x1", 0);
            		timeLineUp.setAttribute("x2", myX2);

            		timeLineDown.setAttribute("x1", 0);
            		timeLineDown.setAttribute("x2", myX2);
                }
                else{
	                timeLineUp.setAttribute("x1", p.x - indicatorLineWidth / 2);
            		timeLineUp.setAttribute("x2", p.x + indicatorLineWidth / 2);

            		timeLineDown.setAttribute("x1", p.x - indicatorLineWidth / 2);
            		timeLineDown.setAttribute("x2", p.x + indicatorLineWidth / 2);
                }

            	// This sets the attributes for the indicators for one unit up and down
            	// p.x and minY are where the mouse currently is
            	// This is for when timeline is locked
        	}
        }
    }

    if (timeLabel) {
        var y = parseInt(timeLine.getAttribute("y1"));
        showCurrAge(p.x,y,evt);
    }
}

function showCurrAge(x,y,evt) {
    var timeLine = document.getElementById("timeline");
    var timeLabel = document.getElementById("TimeLineLabel");
    var timeLabelUp = document.getElementById("TimeLineLabelUp");
    var timeLabelDown = document.getElementById("TimeLineLabelDown");

    if(timeLabel && timeLine) {
        var minY = parseFloat(timeLine.getAttribute("minY"));
        var scale = parseFloat(timeLine.getAttribute("vertScale"));
        var topAge = parseFloat(timeLine.getAttribute("topAge"));
        var currY = minY;
        if (y > minY){
            currY = y;
        }
        var currAge = topAge + ((currY - minY)/scale);
        var myBox = Number(timeLine.getAttribute("isBox"));
        var myHeight = Number(timeLine.getAttribute("boxHeight"));
        var myTime = Math.round(currAge*1000)/1000;
        var myStart = myTime - (myHeight/2);
        var myEnd = myTime + (myHeight/2);
        var myMode = Number(timeLine.getAttribute("regMode"));
        var mySum = getRVal(myStart, myEnd, myMode);

        timeLabel.setAttribute("x", x + 12);
        timeLabel.setAttribute("y", currY - 5);

        timeLabelUp.setAttribute("x", x - 25);
        timeLabelDown.setAttribute("x", x - 21);

        if(myBox > 0){
        	timeLabel.firstChild.nodeValue = mySum;

	        timeLabelUp.setAttribute("y", currY - ((myHeight/2)+1)*scale + 4.5);
	        timeLabelUp.firstChild.nodeValue = myStart;

	        timeLabelDown.setAttribute("y", currY + ((myHeight/2)+1)*scale + 4.5);
	        timeLabelDown.firstChild.nodeValue = myEnd;
        }

        else{
        	timeLabel.firstChild.nodeValue = myTime;

	        timeLabelUp.setAttribute("y", currY - scale + 4.5);
	        timeLabelUp.firstChild.nodeValue = -1;

	        timeLabelDown.setAttribute("y", currY + scale + 4.5);
	        timeLabelDown.firstChild.nodeValue = +1;
        }
    }
}

function getRVal(thisStart, thisEnd, thisMode){
	var thisData = document.getElementsByTagName("myData");
	var thisLength = thisData.length;

	var mySum = 0;

	var B0 = 0;
	var B1 = 0;
	var B2 = 0;

	//Sums
	var sum_x1 = 0;
	var sum_x2 = 0;
	var sum_y = 0;

	var sum_x1_sq = 0;
	var sum_x2_sq = 0;
	var sum_y_sq = 0;

	var sum_x1y = 0;
	var sum_x2y = 0;
	var sum_x1x2 = 0;

	//Summation Quantities
	var SS_x1_y = 0;
	var SS_x2_y = 0;
	var SS_x1_x1 = 0;
	var SS_x2_x2 = 0;
	var SS_x1_x2 = 0;
	var SS_y_y = 0;

	var Y_avg = 0;
	var X1_avg = 0;
	var X2_avg = 0;

	var r = 0;
	var r_Sq = 0;
	var Y_pred = 0;

	//Regression Quantities
	var SSResid = 0;
	var SSTotal = 0;
	var MSTr= 0;
	var MSE = 0;
	var fVal = 0;

	var myX = 0;
	var myY = 0;

	var XData = null;
	var YData = null;

	var thisBase = 0;
	var myTracker = 0;
	var yourTracker = 0;

	var mode = thisMode;

	var myLength = 0;
	var corr_dir = 1;

	var fin_r = 0;

	while(myTracker < thisLength) {
    	trackData = thisData.item(myTracker);

    	thisBase = parseFloat(trackData.getAttribute("baseAge"));
    	myY = parseFloat(trackData.getAttribute("myValueY"));
    	myX = parseFloat(trackData.getAttribute("myValueX"));


    	if(thisStart <= thisBase && thisBase <= thisEnd) {
			sum_y += myY;
			sum_y_sq += Math.pow(myY, 2);

			sum_x2 += Math.pow(myX, 2);
			sum_x2_sq += Math.pow(myX, 4);

			sum_x2y += (myY * Math.pow(myX, 2));

			if(mode == 2){
				sum_x1 += Math.exp(myX);
				sum_x1_sq += Math.pow(Math.exp(myX), 2);
				sum_x1y += (Math.exp(myX) * myY);
			} else if(mode == 3){
				sum_x1 += Math.log(myX);
				sum_x1_sq += Math.pow(Math.log(myX), 2);
				sum_x1y += (Math.log(myX) * myY);
			} else{
				sum_x1 += myX;
				sum_x1_sq += Math.pow(myX, 2);
				sum_x1y += (myX * myY);
				sum_x1x2 += (myX * Math.pow(myX, 2));
			}

			myLength++;
    	}

    	myTracker++;
	}


	Y_avg = sum_y/myLength;
	X1_avg = sum_x1/myLength;
	X2_avg = sum_x2/myLength;

	SS_x1_y = sum_x1y - ( (sum_x1*sum_y) / myLength );
	SS_x2_y = sum_x2y - ( (sum_x2*sum_y) / myLength );
	SS_x1_x1 = sum_x1_sq - ( Math.pow(sum_x1,2) / myLength );
	SS_x2_x2 = sum_x2_sq - ( Math.pow(sum_x2,2) / myLength );
	SS_x1_x2 = sum_x1x2 - ( (sum_x1*sum_x2) / myLength );
	SS_y_y = sum_y_sq - ( Math.pow(sum_y, 2) / myLength);

	if (mode == 4){
		B1 = ((SS_x1_y * SS_x2_x2) - (SS_x2_y * SS_x1_x2)) / ((SS_x1_x1 * SS_x2_x2) - (Math.pow(SS_x1_x2, 2)));
		B2 = ((SS_x2_y * SS_x1_x1) - (SS_x1_y * SS_x1_x2)) / ((SS_x1_x1 * SS_x2_x2) - (Math.pow(SS_x1_x2, 2)));
		B0 = Y_avg - B1*X1_avg - B2*X2_avg;

		while(yourTracker < thisLength) {
	    	trackData = thisData.item(yourTracker);

    	    thisBase = parseFloat(trackData.getAttribute("baseAge"));

        	if(thisStart <= thisBase && thisBase <= thisEnd) {
	        	myY = parseFloat(trackData.getAttribute("myValueY"));
	    		myX = parseFloat(trackData.getAttribute("myValueX"));

				Y_pred = B0 + (B1*myX) + (B2*Math.pow(myX, 2));
				SSResid += Math.pow((myY - Y_pred), 2);
				SSTotal += Math.pow((myY - Y_avg), 2);
        	}

        	yourTracker++;
		}

		r_Sq = 1 - (SSResid / SSTotal);
		r = Math.sqrt(r_Sq);
	} else{
		B1 = SS_x1_y / SS_x1_x1;
		B0 = (sum_y - (B1 * sum_x1) ) / myLength;
		if(B1 < 0){
			corr_dir = -1;
		}

		while(yourTracker < thisLength) {
	    	trackData = thisData.item(yourTracker);

    	    thisBase = parseFloat(trackData.getAttribute("baseAge"));

        	if(thisStart <= thisBase && thisBase <= thisEnd) {
	        	myY = parseFloat(trackData.getAttribute("myValueY"));
	    		myX = parseFloat(trackData.getAttribute("myValueX"));

				if(mode == 2){
					Y_pred = B0 + (B1*Math.exp(myX));
				} else if(mode == 3){
					Y_pred = B0 + (B1*Math.log(myX));
				} else{
					Y_pred = B0 + (B1*myX);
				}

				SSResid += Math.pow((myY - Y_pred), 2);
				SSTotal += Math.pow((myY - Y_avg), 2);
        	}

        	yourTracker++;
		}

		r_Sq = 1 - (SSResid / SSTotal);
		r = Math.sqrt(r_Sq);
	}

	r = Math.round(r*1000.000)/1000.000;
	fin_r = r*corr_dir;
	return fin_r;

}

function hideLine() {
    var timeLine = document.getElementById("timeline");
	var timeLineUp = document.getElementById("timeline_up");
	var timeLineDown = document.getElementById("timeline_down");

    var timeLabel = document.getElementById("TimeLineLabel");
    var timeLabelUp = document.getElementById("TimeLineLabelUp");
    var timeLabelDown = document.getElementById("TimeLineLabelDown");

    timeLabel.setAttributeNS(null, "visibility", "visible");
    timeLabelUp.setAttributeNS(null, "visibility", "visible");
    timeLabelDown.setAttributeNS(null, "visibility", "visible");

    if (timeLine && timeLabel) {
        timeLine.setAttribute("style", hideTimeLine ? "stroke-opacity: 0;" : "stroke: red; stroke-opacity: 0.5;");
        timeLineUp.setAttribute("style", hideTimeLine ? "stroke-opacity: 0;" : "stroke: red; stroke-opacity: 0.5;");
        timeLineDown.setAttribute("style", hideTimeLine ? "stroke-opacity: 0;" : "stroke: red; stroke-opacity: 0.5;");
        timeLabel.setAttribute("style", hideTimeLine ? "fill-opacity: 0;" : "font-size: 10; fill: red; fill-opacity: 0.7;");
        timeLabelUp.setAttribute("style", hideTimeLine ? "fill-opacity: 0;" : "font-size: 10; fill: red; fill-opacity: 0.7;");
        timeLabelDown.setAttribute("style", hideTimeLine ? "fill-opacity: 0;" : "font-size: 10; fill: red; fill-opacity: 0.7;");
    }
}

function browserFix()
{
 var patterns = document.getElementsByTagName("pattern");

 var length = patterns.length;
 for (i=0; i<length; i++)
 {
     var pattern = patterns[i];
     var viewbox = pattern.getAttribute("viewBox");
     if (viewbox == null)
         continue;
     viewbox = viewbox.split(" ");

     var transx = -parseFloat(viewbox[0]);
     var transy = -parseFloat(viewbox[1]);
     pattern.removeAttribute("viewBox");

     var children = pattern.childNodes;
     var clength = children.length;
     for (j=0; j<clength; j++)
     {
         var child = children[j];

	if(child.nodeType != 1)
		continue;

         var transform = child.getAttribute("transform");
         if (transform != "")
             transform += " ";
         child.setAttribute("transform", "translate(" + transx + "," + transy + ")");
     }
 }
}
